import { Component } from "react";
import api from "./OpenAI";

class OpenAIPetNames extends Component {
    state = {
        petNames: [],
        specie: '',
    }
    api = api;

    componentDidMount(specie) {
        this.api.post("nlp-pet-name/specie/"+specie).then(
          res =>{
            console.log(res.data);
            const specie = res.data.specie;
            this.setState({ specie });

            const petNames = res.data.names;
            this.setState({ petNames });

        })
    }

    render(){
      return(
        <div className="result-pet-names">
          <ul>
            {console.log(this.state.petNames)}
            {console.log(this.state.specie)}
            {/* {this.state.petNames.map(petName => <li>{petName.names}</li>)} */}
          </ul>
        </div>
      )
    }
    getPetNames(specie) {
        return this.api
        .post("nlp-pet-name/specie/"+specie,{
          specie: specie
        })
        .then((response) => response.data)
        .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
        });
    }

